import React from "react";
import styled from "styled-components";
import Map from "./Map";

const FotterContainer = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  width: 100%;
  height: 500px;
  background: #495057;
  border-top-right-radius: 4px;
  border-top-left-radius: 4px;
`;

const Fotter = () => {
  return (
    <FotterContainer>
      <MapAPI />
    </FotterContainer>
  );
};

export default Fotter;
